export type RootKey = {
  address: string,
  name: string
}


/**
 * Converts the ABI tuple representation of a RootKey to the struct representation
 */
export function RootKeyFromTuple(abiTuple: [string, string]) {
  return getABIStructFromABITuple(abiTuple, APP_SPEC.structs.RootKey, APP_SPEC.structs) as RootKey
}

export type DataKey = {
  address: Uint8Array,
  name: string,
  key: string
}


/**
 * Converts the ABI tuple representation of a DataKey to the struct representation
 */
export function DataKeyFromTuple(abiTuple: [Uint8Array, string, string]) {
  return getABIStructFromABITuple(abiTuple, APP_SPEC.structs.DataKey, APP_SPEC.structs) as DataKey
}

